function get () {
    let num = Number(document.getElementById("cel").value)
    let ans = (num*1.8)+32;  
    document.getElementById("far").innerHTML="Fahrenheit :" +ans
     if (ans<=65)
      {
        document.getElementById("far").style.color ="blue"  
        document.getElementById("cel").style.outline="2px solid green"
        document.getElementById("base").classList.remove("bg-warning")
        document.getElementById("base").style.backgroundImage="url('data:image/jpeg;base64,')"

       }
              else if(ans<=90)
        {
         document.getElementById("far").style.color ="orange"
         document.getElementById("cel").style.outline="2px solid green"
         document.getElementById("base").classList.remove("bg-warning")
         document.getElementById("base").style.backgroundImage="url('data:image/jpeg;base64,')"
               }    
              else 
                {
         document.getElementById("far").style.color ="red"
         document.getElementById("cel").style.outline="2px solid green"
         document.getElementById("base").classList.remove("bg-warning")
         document.getElementById("base").style.backgroundImage="url('data:image/jpeg;base64,')"
        } 
             if (num=="") 
             {
               document.getElementById("far").innerHTML="NaN"
               document.getElementById("cel").style.outline="2px solid red"
            
             }
     }   
function clr()
{
   document.getElementById('cel').value=" "
   document.getElementById('far').innerHTML=" "
   document.getElementById("base").classList.add("bg-warning")
   if (num=="") 
   {
     document.getElementById("far").innerHTML="NaN"
     document.getElementById("cel").style.outline="2px solid red"
  
   }
}